import React from 'react';
import './styles.css';
import { Button } from 'semantic-ui-react';
import 'semantic-ui-css/semantic.min.css'

export default class KanbanBoard extends Component {

refresh = () => {
  window.location.reload();
}

render() {
  return (
    <div className="mt-20 layout-column justify-content-center align-items-center">
  <div className="main">
      <div className="top">
        <p className="header">Weather in Stockholm today</p>
        <Button className="button" inverted color='blue' circular icon='refresh' onClick={refresh} />
      </div>
      <div className="flex">
        <p className="day"><span>Hello</span></p>
        <p className="description">Hello</p>
      </div>

      <div className="flex">
        <p className="temp">Temprature:</p>
        <p className="temp">Humidity:</p>
      </div>

      <div className="flex">
        <p className="sunrise-sunset">Sunrise:</p>
      </div>

  </div>
  </div>

  )
  }
}
